(function() {
    'use strict';
    //延迟运行的网址列表
     const DelayRunWeb = [
        'https://yiyan.baidu.com/',
        'https://www.bilibili.com/',
        'space.bilibili.com/',
        'https://message.bilibili.com/',
        'https://greasyfork.org/',
        ,
    ];

    //延迟时间档位
    const delayTime0 = 0;
    const delayTime1 = 1000;
    const delayTime2 = 1500;
    const delayTime3 = 2000;
    const delayTime4 = 5000;
    const delayTime5 = 6000;
    const delayTime6 = 8000;

    //需要去除的网页元素
    const elementsToRemove = [

        /*翻译*/
        'div._translate-option_1jhxg_81:nth-of-type(2)',
        'div.print-hide:nth-of-type(2)',
        '._translate-option_1jhxg_81',
        '._selected_1jhxg_156._translate-option_1jhxg_81',
        '._lowerNavBar_1jhxg_321.print-hide.notranslate._navbar-container_4x7s4_1',
        '._remove-icon_16dm3_175 > svg > path',
        '#mount&&.header-navbar,0',
        '1',
        '1',
        '1',
        '1',

    ];


        // 检查当前网址是否匹配延时运行的网址列表
    function isDelayRunWeb() {
        const currentUrl = window.location.href;
        for (const DelayRun of DelayRunWeb) {
            if (currentUrl.includes(DelayRun)) {
                return true;
            }
        }
        return false;
    };


    // 移除元素
    function removeElements() {
        elementsToRemove.forEach(elementselector => {
            const elements = document.querySelectorAll(elementselector);
            elements.forEach(element => {
                element.remove();
            });
        });
    };


    //延迟移除元素
    function removeDelay(){
     document.addEventListener('DOMContentLoaded', () => {
       if (isDelayRunWeb()) {
        setTimeout(removeElements, delayTime3);
        setTimeout(removeElements, delayTime4);
        };
    });
        window.addEventListener('load', () => {
       if (isDelayRunWeb()) {
        setTimeout(removeElements, delayTime3);
        setTimeout(removeElements, delayTime4);
       };
    });

    }

    //设置清理元素的监听器
    document.addEventListener('DOMContentLoaded', () => {
       if (!isDelayRunWeb()) {
        removeElements();
        }else{removeDelay();}
    });
    window.addEventListener('load', () => {
        if (!isDelayRunWeb()) {
        removeElements();
        }else{removeDelay();}
    });






})();
